import { DefaultTheme } from 'styled-components';

const colors = {
    primaryBlue: '#253858',
    blueLight: '#42526E',
    greyDark: '#c9c9c9',
    greyMid: '#E0E0E0',
    greyLight: '#EDF0F2',
}

export const defaultTheme : DefaultTheme = {
    colors
}
